// src/components/Header.js
import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
    return (
        <header style={{
            display: 'flex',
            justifyContent: 'space-between',
            alignItems: 'center',
            padding: '1rem 2rem',
            backgroundColor: '#282c34',
            color: 'white',
            boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)'
        }}>
            <div style={{
                fontSize: '1.5rem',
                fontWeight: 'bold'
            }}>
                <Link to="/" style={{ color: 'white', textDecoration: 'none' }}>MyPortfolio</Link>
            </div>
            <nav>
                <ul style={{
                    display: 'flex',
                    listStyle: 'none',
                    gap: '1.5rem',
                    margin: 0,
                    padding: 0
                }}>
                    <li><Link to="/" style={{ color: 'white', textDecoration: 'none' }}>Home</Link></li>
                    <li><Link to="/about" style={{ color: 'white', textDecoration: 'none' }}>About Me</Link></li>
                    <li><Link to="/projects" style={{ color: 'white', textDecoration: 'none' }}>Projects</Link></li>
                    <li><Link to="/contact" style={{ color: 'white', textDecoration: 'none' }}>Contact</Link></li>
                </ul>
            </nav>
        </header>
    );
};

export default Header;
